I know I’ve posted a lot about this on my story today, so I thought I’d make an actual post about this. All I have to say is… GOD IS SO GOOD!!! God has given us another chance to do things right in this country! This is only the beginning! We must follow God’s law no matter how we feel about it! God is perfect and we are not! That’s why we worship a perfect God! This feels so amazing, but the work has only just begun! Celebrate for now all you want, but once the sun comes up tomorrow, we must fight HARD to make abortion illegal! Call your Representatives first thing in the morning and let them know that you want to make abortion completely illegal (with no exceptions) in your state! I love you guys so much! Let’s keep up the hard work! WE ARE THE PRO-LIFE GENERATION!!! NOW IT’S TIME TO FIGHT!!! God bless you all!!!🙏🏼✝️🇺🇸

“But whoso shall offend one of these little ones which believe in me, it were better for him that a millstone were hanged about his neck, and that he were drowned in the depth of the sea.” - Matthew 18:6 (KJV)

